const Sidebar = () => {
  return (
    <div style={{ width: '250px', height: '100vh', background: '#f0f0f0' }}>
      {/* Sidebar content here */}
      <button>모임 만들기</button>
      {/* Add more buttons or links as needed */}
    </div>
  );
};

export default Sidebar;
